void colorFilterR(){
    while(1){
        if(colorseancor.hue() >= 20 || colorseancor.hue() <= 40){  // Check if the color sensor detects the color
            wait(300, msec);     // Wait for 300 ms
            intas.stop();        // Stop the motors
        }
    }
}

void colorFilterB(){
    while(1){
    int detectedColor = colorseancor.hue();
        if(detectedColor >= 140 && detectedColor<=180){  // Check if the color sensor detects blue
            wait(300, msec);  // Wait for 300 ms
            intas.stop();  // Stop the motors
            break;  // Exit the loop after stopping the motors
        }
        wait(20, msec);  // Small delay to avoid locking the processor
    }
}

